              <p className='small-paragraph'>MY CREATIVE ENDEAVORS</p>
              <h1>fleurcreme</h1>
            </div>
            <div className='divider'/> 
            <div className='description descr-contain'>

              <p className='small-paragraph'>In high school, fleurcreme started as an attempt at adding creativity and artistic perspective to note-taking and journaling through photography and blogging on Instagram. Now, it has extended into a journal of my life, whether this involves the occasional dinner blog or capturing a study date at a cafe Iâ€™ve saved on Yelp! </p>
            </div>
